import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question(props) {
    let id = props.id;
    const q = props.getquestionid(id);

    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{props.title}</p>
        </Paper>
    )
}

export default Question;
